package leetcode_test

import (
	"fmt"
	"testing"

	"github.com/nogurenn/practice-go/leetcode"
	"github.com/stretchr/testify/assert"
	"github.com/stretchr/testify/suite"
)

func TestTwoSum(t *testing.T) {
	testCases := []struct {
		subtest string
		nums    []int
		target  int
		want    []int
	}{
		{
			subtest: "Example 1",
			nums:    []int{2, 7, 11, 15},
			target:  9,
			want:    []int{0, 1},
		},
		{
			subtest: "Example 2",
			nums:    []int{3, 2, 4},
			target:  6,
			want:    []int{1, 2},
		},
		{
			subtest: "Example 3",
			nums:    []int{3, 3},
			target:  6,
			want:    []int{0, 1},
		},
	}

	for _, tc := range testCases {
		t.Run(tc.subtest, func(t *testing.T) {
			got := leetcode.TwoSum(tc.nums, tc.target)
			assert.Equal(t, tc.want, got)
		})
	}
}

func TestIsAnagram(t *testing.T) {
	testCases := []struct {
		subtest string
		s       string
		t       string
		want    bool
	}{
		{
			subtest: "Example 1",
			s:       "anagram",
			t:       "nagaram",
			want:    true,
		},
		{
			subtest: "Example 2",
			s:       "rat",
			t:       "car",
			want:    false,
		},
	}

	for _, tc := range testCases {
		t.Run(tc.subtest, func(t *testing.T) {
			got := leetcode.IsAnagram(tc.s, tc.t)
			assert.Equal(t, tc.want, got)
		})
	}
}

