type IntersectionOfTwoLinkedListsTestSuite struct {
	suite.Suite
	testCases []struct {
		subtest string
		headA   *leetcode.ListNode
		headB   *leetcode.ListNode
		want    *leetcode.ListNode
	}
}

func (suite *IntersectionOfTwoLinkedListsTestSuite) SetupTest() {
	suite.testCases = []struct {
		subtest string
		headA   *leetcode.ListNode
		headB   *leetcode.ListNode
		want    *leetcode.ListNode
	}{}

	// Construct the linked lists
	// headA: 4 -> 1 -> 8 -> 4 -> 5
	// headB: 5 -> 0 -> 1 -> 8 -> 4 -> 5
	// Ensure that the intersection is at node with value 8
	// Make a generator loop for the linked lists
	values := []struct {
		headA []int
		headB []int
		// index of headA where the intersection is
		// If it is negative, then there is no intersection (< 0)
		intersection int
	}{
		{
			headA:        []int{4, 1, 8, 4, 5},
			headB:        []int{5, 0, 1},
			intersection: 2,
		},
	}

	for i, v := range values {
		headA := leetcode.NewListNodeFromInts(v.headA...)
		headB := leetcode.NewListNodeFromInts(v.headB...)

		// Find the intersection node
		var intersectionNode *leetcode.ListNode
		if v.intersection >= 0 {
			intersectionNode = headA
			for j := 0; j < v.intersection; j++ {
				intersectionNode = intersectionNode.Next
			}
		}

		// Link the intersection node to the rest of headB
		if intersectionNode != nil {
			current := headB
			for current.Next != nil {
				current = current.Next
			}
			current.Next = intersectionNode
		}

		suite.testCases = append(suite.testCases, struct {
			subtest string
			headA   *leetcode.ListNode
			headB   *leetcode.ListNode
			want    *leetcode.ListNode
		}{
			subtest: fmt.Sprintf("Example %d", i+1),
			headA:   headA,
			headB:   headB,
			want:    intersectionNode,
		})
	}
}

func (suite *IntersectionOfTwoLinkedListsTestSuite) TestApproaches() {
	approaches := []struct {
		name string
		fn   func(*leetcode.ListNode, *leetcode.ListNode) *leetcode.ListNode
	}{
		{
			name: "Hashmap",
			fn:   leetcode.GetIntersectionNodeHashmap,
		},
		{
			name: "Two Pointers",
			fn:   leetcode.GetIntersectionNodeTwoPointers,
		},
	}

	for _, approach := range approaches {
		for _, tc := range suite.testCases {
			suite.Run(approach.name+"/"+tc.subtest, func() {
				got := approach.fn(tc.headA, tc.headB)
				suite.Equal(tc.want, got)
			})
		}
	}
}

